import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom'; // Ensure this import is included

import './Static/Front.css';


function Frontpage() {
  const [activeDropdown, setActiveDropdown] = useState(null);
  const [isScrolled, setIsScrolled] = useState(false);

  const toggleDropdown = (index) => {
    setActiveDropdown(activeDropdown === index ? null : index);
  };

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const navItems = ['HOME', 'ABOUT US','CONTACT', 'SIGNUP', 'SIGNIN'];


  return (
    <div className="container">
    <header className={isScrolled ? 'scrolled' : ''}>
      <div className="header-content">
        <div className="logo">
          <img src="data:image/svg+xml;base64," alt="ScrapSpot Logo" className="logo-image" />
        </div>
        <nav className="header-links">
            {navItems.map((item, index) => (
              <div key={index} className="nav-item">
                <Link
                  to={item === 'LOGIN' ? '/login' : `/${item.toLowerCase()}`}
                  onClick={() => toggleDropdown(index)}
                >
                  {item}
                </Link>
                {/* {shouldRenderDropdown(item, index) && (
                  <div className="dropdown-content">
                    {renderDropdownContent(item)}
                  </div>
                )} */}
              </div>
            ))}
          </nav>
        </div>
      </header>

      <main>
        <section className="hero">
          <div className="hero-content">
            <h1>
              <b>
                <h1>Scrap smart, live green </h1>
                <h1>Schedule your pickup today{' '}</h1>
                <span className="door-step">make yourself <span className="scrap-free">ScrapFree</span></span>
              </b>
            </h1>
            <p>
              Is your storeroom filled with scrap and old things? You are at the right place. It's
              time to clean and sell your scrap to us. Sell your Kabad to us.
            </p>
            <Link to="/signin">
          <button className="book-collection">BOOK A COLLECTION</button>
          </Link>
          </div>
        </section>

        <section className="about">
  <h2>About ScrapSavvy</h2>
  <p>
  ScrapSavvy is a pioneering start-up based in Pune, dedicated to revolutionizing waste management through advanced technology and innovation. Our platform seamlessly integrates traditional waste collection practices with cutting-edge automation, creating a streamlined, professional, and eco-conscious solution for managing waste.
  </p>
  <p>
    We are committed to delivering a hassle-free and efficient waste management experience for households, businesses, and institutions alike. Our mission is to promote sustainability by reducing the environmental impact of waste disposal, leveraging state-of-the-art technology and innovative logistics. We aim to make waste management not only more accessible and convenient but also environmentally responsible.
  </p>
  <p>
    At ScrapSavvy, we envision a future where waste management transcends beyond mere collection and disposal. We believe in fostering a circular economy where waste is viewed as a resource, benefiting both communities and the environment. By connecting waste generators with certified recyclers and processors, our platform ensures that every piece of waste is handled with the utmost responsibility and care, contributing to a greener, cleaner planet.
  </p>
</section>


        <section className="services">
          <h2>Our Services</h2>
          <div className="service-cards">
            <div className="service-card">
              <i className="fas fa-recycle"></i>
              <h3>Recycling</h3>
              <p>We recycle various materials to help preserve our environment.</p>
            </div>
            <div className="service-card">
              <i className="fas fa-truck"></i>
              <h3>Door-step Collection</h3>
             <p>We collect scrap materials directly from your doorstep.</p>
            </div>
            <div className="service-card">
              <i className="fas fa-money-bill-wave"></i>
              <h3>Best Rates</h3>
              <p>We offer competitive rates for your scrap materials.</p>
            </div>
          </div>
        </section>
      </main>

     
    </div>
  );
}

function shouldRenderDropdown(item, index) {
  return ['BUY', 'SELL', 'Login'].includes(item);
}


export default Frontpage;